package net.jeeshop.services.front.appVehicle.dao;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.common.AppVehicle;public class AppVehicleDaoImpl implements AppVehicleDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(AppVehicle e) {  		return dao.selectPageList("front.appVehicle.selectPageList",				"front.appVehicle.selectPageCount", e);	}	@Override	@SuppressWarnings("unchecked")	public List selectList(AppVehicle e) {		return dao.selectList("front.appVehicle.selectList", e);	}	@Override	public AppVehicle selectOne(AppVehicle e) {		return (AppVehicle) dao.selectOne("front.appVehicle.selectOne", e);	}	@Override	public int delete(AppVehicle e) {		return dao.delete("front.appVehicle.delete", e);	}	@Override	public int update(AppVehicle e) {		return dao.update("front.appVehicle.update", e);	}		@Override	public int insert(AppVehicle e) {		return dao.insert("front.appVehicle.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("front.appVehicle.deleteById", id);	}	@Override	public AppVehicle selectById(String id) {		return (AppVehicle) dao.selectOne("front.appVehicle.selectById", id);	}}